// Obtenha o valor da variável do Grafana (certifique-se de que a variável esteja configurada no painel do Grafana)
const valorCompany = getGrafanaVariableValue("$company");

if (sessionStorage.getItem('grafana.user.company') === null) {
    sessionStorage.setItem('grafana.user.company', valorCompany);
}

if (sessionStorage.getItem('grafana.user.company') === "-1" && valorCompany == "-1") {
    window.location.replace(`http://localhost:${window.location.port}/orgId=1`);
} else {
    // Defina o item no localStorage se for a primeira execução
    const companyIdFromLocalStorage = sessionStorage.getItem('grafana.user.company');

    const homeURL = `http://localhost:${window.location.port}/d/f29eb8e9-aa99-46b7-ba2c-7c8bdbf35eb1/aplicacao-tcc?orgId=1`;
    const baseDesiredURL = `http://localhost:${window.location.port}/d/f29eb8e9-aa99-46b7-ba2c-7c8bdbf35eb1/aplicacao-tcc?var-company=${companyIdFromLocalStorage}&orgId=1`;


    if (valorCompany !== companyIdFromLocalStorage || window.location.href === homeURL || window.location.href === baseDesiredURL + "&viewPanel=22") {
        window.location.replace(baseDesiredURL);
    }

}

function getGrafanaVariableValue(variable) {
    return getTemplateSrv().replace(variable);
}

